    public class RavenDB_15608 : RavenTestBase
    {
        public RavenDB_15608(ITestOutputHelper output) : base(output)
        {
        }

        [Theory]
        [JavaScriptEngineClassData]
        public async Task ArtificalDocumentsMatchIndexEntries(string jsEngineType)
        {
            using (var store = GetDocumentStore(Options.ForJavaScriptEngine(jsEngineType)))
            {
                await new SeasonHarvestEstimates_ByDeliverySite().ExecuteAsync(store);

                await PopulateSeasonVarietyGradeGroups(store);

                var year = "2021";
                var elementsCount = 15000;
                var siteCodes = Enumerable.Range(0, 150).Select(x => RandomString(5)).ToList();

                using (var session = store.OpenAsyncSession())
                {
                    var seasonVarietyGradeGroups = await session.Query<SeasonVarietyGradeGroup>().ToListAsync();

                    var seasonHarvestEstimate = new SeasonHarvestEstimate()
                    {
                        SeasonCode = year,
                        PropertyVarietyEstimates = new List<PropertyVarietyEstimate>()
                    };

                    var gradeGroups = seasonVarietyGradeGroups.Where(x => x.SeasonCode == year)
                        .Take(200).ToArray();

                    for (var i = 0; i < elementsCount; i++)
                    {
                        var gg = RandomElement(gradeGroups);

                        seasonHarvestEstimate.PropertyVarietyEstimates.Add(new PropertyVarietyEstimate
                        {
                            PropertyCode = i.ToString(),
                            NearestSiteCode = RandomElement(siteCodes),
                            DestinationSiteCode = RandomElement(siteCodes),
                            CommodityCode = gg.CommodityCode,
                            VarietyCode = gg.VarietyCode,
                            EstimatedHectares = _random.Next(20, 500)
                        });
                    }

                    await session.StoreAsync(seasonHarvestEstimate);

                    await session.SaveChangesAsync();
                }

                await AssertCounts(store);

                for (var i = 0; i < 30; i++)
                {
                    using (var session = store.OpenAsyncSession())
                    {
                        var randomToRemove = _random.Next(0, elementsCount);
                        session.Advanced.Patch<SeasonHarvestEstimate, PropertyVarietyEstimate>(SeasonHarvestEstimate.CalculateId(year), x => x.PropertyVarietyEstimates, x => x.RemoveAt(randomToRemove));
                        await session.SaveChangesAsync();
                        elementsCount--;
                    }

                    await AssertCounts(store);
                }
            }
        }

        private async Task AssertCounts(DocumentStore store)
        {
            WaitForIndexing(store);

            using (var session = store.OpenAsyncSession())
            {
                var indexCountLazy = session.Query<DeliverySiteEstimate, SeasonHarvestEstimates_ByDeliverySite>().CountLazilyAsync();
                var collectionCountLazy = session.Query<DeliverySiteEstimate>().CountLazilyAsync();

                var indexCount = await indexCountLazy.Value;
                var collectionCount = await collectionCountLazy.Value;

                Assert.Equal(indexCount, collectionCount);
            }
        }

        private static readonly Random _random = new Random();

        private static string RandomString(int length)
        {
            const string chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
            return new string(Enumerable.Repeat(chars, length)
                .Select(s => s[_random.Next(s.Length)]).ToArray());
        }

        private static T RandomElement<T>(ICollection<T> collection)
        {
            return collection.ElementAt(_random.Next(0, collection.Count));
        }

        private class SeasonVarietyGradeGroup
        {
            public static string CalculateId(string seasonCode, string commodityCode, string varietyCode) => $"seasonVarietyGradeGroup/{seasonCode}/{commodityCode}/{varietyCode}";
            public string Id => CalculateId(SeasonCode, CommodityCode, VarietyCode);

            public string SeasonCode { get; set; }
            public string CommodityCode { get; set; }
            public string VarietyCode { get; set; }
            public string GradeGroupCode { get; set; }
        }

        private class SeasonHarvestEstimate
        {
            public static string CalculateId(string seasonCode) => $"seasonHarvestEstimate/{seasonCode}";

            public string Id => CalculateId(SeasonCode);

            public string SeasonCode { get; set; }

            public List<PropertyVarietyEstimate> PropertyVarietyEstimates { get; set; }
        }

        private class PropertyVarietyEstimate
        {
            public string PropertyCode { get; set; }
            public string NearestSiteCode { get; set; }

            public string DestinationSiteCode { get; set; }

            public string CommodityCode { get; set; }
            public string VarietyCode { get; set; }
            public decimal EstimatedHectares { get; set; }
        }

        private class SeasonHarvestEstimates_ByDeliverySite : AbstractIndexCreationTask<SeasonHarvestEstimate, DeliverySiteEstimate>
        {
            public SeasonHarvestEstimates_ByDeliverySite()
            {
                Map = seasonHarvestEstimates => from seasonHarvestEstimate in seasonHarvestEstimates
                                                from propertyVarietyEstimate in seasonHarvestEstimate.PropertyVarietyEstimates
                                                select new DeliverySiteEstimate
                                                {
                                                    CommodityCode = propertyVarietyEstimate.CommodityCode,
                                                    DeliverySiteCode = propertyVarietyEstimate.DestinationSiteCode,
                                                    NearestSiteEstimates = new[]
                                                    {
                                                    new DeliverySiteEstimate.NearestSiteEstimate()
                                                    {
                                                        PropertyNearestSiteCode = propertyVarietyEstimate.NearestSiteCode,
                                                        Hectares = propertyVarietyEstimate.EstimatedHectares
                                                    }
                                                }
                                                };

                Reduce = results => from result in results
                                    group result by new { result.CommodityCode, result.DeliverySiteCode } into g
                                    select new DeliverySiteEstimate
                                    {
                                        CommodityCode = g.Key.CommodityCode,
                                        DeliverySiteCode = g.Key.DeliverySiteCode,
                                        NearestSiteEstimates = g.SelectMany(x => x.NearestSiteEstimates)
                                                                .GroupBy(x => x.PropertyNearestSiteCode)
                                                                .Select(gg => new DeliverySiteEstimate.NearestSiteEstimate()
                                                                {
                                                                    PropertyNearestSiteCode = gg.Key,
                                                                    Hectares = gg.Sum(x => x.Hectares)
                                                                }).ToArray()
                                    };

                OutputReduceToCollection = "DeliverySiteEstimates";
            }
        }

